import React from 'react';
import './App.css';
import Infograph from './components/Infograph/infograph';
import MyBio from './components/Story/story';
import Test from './components/Test/test';
import NavBar from './components/Nav/nav';
import RenderWalk from './components/Parks and weather/parks';
import Gamefield from './components/game/grid';
import Spoink from './components/game/grid';

//const AppLayout = styled.div
function App() {
  return (
    <div className='app'
>
      <NavBar />
      <MyBio className='bio' />
      <Infograph className='chart' />
      <Test className='form'/>
      <RenderWalk />
      <Gamefield />
      <Spoink />

    </div>
  );
}

export default App;
